import React from "react"


class AddUser extends React.Component {
  render() {
    return(
     <form>   
        <input placeholder='Ima' />
        <input placeholder='Familiya' />
        <textarea placeholder='Bioqrafiya'></textarea>
        <input placeholder='Vozrast' />
        <label htmlFor="isHappy">Schastliv</label>
        <input type="checkbox" id="isHappy" />
        <button type="button">Dobavit</button>
     </form>   
    )
  }
}

export default AddUser
